function updateDates(n){$("#Time").empty();n.forEach(n=>$("#Time").append($("<option>",{text:n})))}function getDates(){$.ajax({type:"GET",url:"/user/appointments/getavaliableappointments/}",data:{doctorId:$("#DoctorId").val(),dateTime:$("#Date").val()},contentType:"application/json; charset=utf-8",dataType:"json",success:function(n){updateDates(n)}})}